import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaTrash, FaEdit } from 'react-icons/fa';

function ServiceProvidersPage() {
  const [serviceProviders, setServiceProviders] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [isEditModalOpen, setIsEditModalOpen] = useState(false);
  const [editedServiceProvider, setEditedServiceProvider] = useState({});
  const [editedProfession, setEditedProfession] = useState('');
  const [editedContact, setEditedContact] = useState('');

  useEffect(() => {
    const fetchServiceProviders = async () => {
      try {
        const response = await axios.get('http://192.168.164.157:8000/ServiceProvider');
        const sortedProviders = response.data.sort((a, b) => {
          if (a.profession < b.profession) return -1;
          if (a.profession > b.profession) return 1;
          return 0;
        });
        setServiceProviders(sortedProviders);
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching service providers:', error);
        setIsLoading(false);
      }
    };

    fetchServiceProviders();
  }, []);

  const handleDelete = async (email) => {
    try {
      await axios.delete(`http://192.168.164.157:8000/ServiceProvider/${email}`);
      setServiceProviders(serviceProviders.filter(serviceProvider => serviceProvider.email !== email));
    } catch (error) {
      console.error('Error deleting service provider:', error);
    }
  };

  const handleEdit = (serviceProvider) => {
    setEditedServiceProvider(serviceProvider);
    setEditedProfession(serviceProvider.profession);
    setEditedContact(serviceProvider.contact);
    setIsEditModalOpen(true);
  };

  const handleEditSubmit = async () => {
    try {
      await axios.put(`http://192.168.164.157:8000/ServiceProvider/${editedServiceProvider.email}`, {
        profession: editedProfession,
        contact: editedContact
      });
      setIsEditModalOpen(false);
      // Refresh service providers after editing
      const response = await axios.get('http://192.168.164.157:8000/ServiceProvider');
      setServiceProviders(response.data);
    } catch (error) {
      console.error('Error editing service provider:', error);
    }
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', minHeight: '100vh', backgroundColor: '#f0f0f0', color: '#000', padding: '20px' }}>
      <h1 style={{ color: '#2980b9', marginBottom: '20px' }}>List of Service Providers</h1>
      {isLoading ? (
        <p>Loading...</p>
      ) : (
        <ul style={{ listStyle: 'none', padding: 0, width: '80%', margin: '0 auto', backgroundColor: '#fff', boxShadow: '0 0 10px rgba(0,0,0,0.1)', borderRadius: '8px' }}>
          {serviceProviders.map((serviceProvider, index) => (
            <li key={index} style={{ marginBottom: '10px', borderBottom: '1px solid #ccc', padding: '10px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <div style={{ flex: '1' }}>
                <p style={{ margin: '5px 0', fontWeight: 'bold' }}>Email: <span style={{ fontWeight: 'normal' }}>{serviceProvider.email}</span></p>
                <p style={{ margin: '5px 0', fontWeight: 'bold' }}>Profession: <span style={{ fontWeight: 'normal' }}>{serviceProvider.profession}</span></p>
                <p style={{ margin: '5px 0', fontWeight: 'bold' }}>Contact: <span style={{ fontWeight: 'normal' }}>{serviceProvider.contact}</span></p>
                <p style={{ margin: '5px 0', fontWeight: 'bold' }}>Password: <span style={{ fontWeight: 'normal' }}>{serviceProvider.password}</span></p>
              </div>
              <div style={{ display: 'flex', gap: '10px' }}>
                <button onClick={() => handleDelete(serviceProvider.email)} style={{ backgroundColor: '#e74c3c', color: '#fff', border: 'none', padding: '10px', borderRadius: '5px', cursor: 'pointer', display: 'flex', alignItems: 'center' }}>
                  <FaTrash style={{ marginRight: '5px' }} /> Delete
                </button>
                <button onClick={() => handleEdit(serviceProvider)} style={{ backgroundColor: '#3498db', color: '#fff', border: 'none', padding: '10px', borderRadius: '5px', cursor: 'pointer', display: 'flex', alignItems: 'center' }}>
                  <FaEdit style={{ marginRight: '5px' }} /> Edit
                </button>
              </div>
            </li>
          ))}
        </ul>
      )}

      {/* Edit Modal */}
      {isEditModalOpen && (
        <div style={{ position: 'fixed', top: 0, left: 0, width: '100%', height: '100%', backgroundColor: 'rgba(0, 0, 0, 0.5)', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
          <div style={{ backgroundColor: '#fff', padding: '20px', borderRadius: '8px', boxShadow: '0 0 10px rgba(0,0,0,0.3)', width: '400px' }}>
            <h2>Edit Service Provider</h2>
            <label style={{ display: 'block', marginBottom: '10px' }}>
              Profession:
              <input type="text" value={editedProfession} onChange={(e) => setEditedProfession(e.target.value)} />
            </label>
            <label style={{ display: 'block', marginBottom: '10px' }}>
              Contact:
              <input type="text" value={editedContact} onChange={(e) => setEditedContact(e.target.value)} />
            </label>
            <button onClick={handleEditSubmit} style={{ backgroundColor: '#3498db', color: '#fff', border: 'none', padding: '10px 20px', borderRadius: '5px', cursor: 'pointer' }}>Save Changes</button>
            <button onClick={() => setIsEditModalOpen(false)} style={{ backgroundColor: '#e74c3c', color: '#fff', border: 'none', padding: '10px 20px', borderRadius: '5px', cursor: 'pointer', marginLeft: '10px' }}>Cancel</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default ServiceProvidersPage;
